import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import SearchBar from './SearchBar';
import 'bootstrap/dist/css/bootstrap.min.css';

const Home = () => {
  const [activeImage, setActiveImage] = useState(0);
  const images = [
    'https://example.com/hotel-image1.jpg',
    'https://example.com/hotel-image2.jpg',
    'https://example.com/hotel-image3.jpg',
  ];

  useEffect(() => {
    const intervalId = setInterval(() => {
      setActiveImage((prevActiveImage) => (prevActiveImage + 1) % images.length);
    }, 5000);
    return () => clearInterval(intervalId);
  }, [images]);

  const handleNextClick = () => {
    setActiveImage((prevActiveImage) => (prevActiveImage + 1) % images.length);
  };

  const handlePrevClick = () => {
    setActiveImage((prevActiveImage) => (prevActiveImage - 1 + images.length) % images.length);
  };

  return (
    <div className="container-fluid">
      <header className="navbar navbar-expand-lg navbar-dark bg-dark">
        <div className="container-fluid">
          <Link to="/" className="navbar-brand">Rental Apartments</Link>
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <Link to="/" className="nav-link">Home</Link>
              </li>
              <li className="nav-item">
                <Link to="/search" className="nav-link">Search Apartments</Link>
              </li>
              <li className="nav-item dropdown">
                <Link to="#" className="nav-link dropdown-toggle" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                  Apartments
                </Link>
                <ul className="dropdown-menu" aria-labelledby="navbarDropdown">
                  <li><Link to="/apartment1" className="dropdown-item">Apartment 1</Link></li>
                  <li><Link to="/apartment2" className="dropdown-item">Apartment 2</Link></li>
                  <li><Link to="/apartment3" className="dropdown-item">Apartment 3</Link></li>
                </ul>
              </li>
              <li className="nav-item">
                <Link to="/about" className="nav-link">About</Link>
              </li>
              <li className="nav-item">
                <Link to="/contact" className="nav-link">Contact</Link>
              </li>
            </ul>
          </div>
        </div>
      </header>
      <div className="hero" style={{ height: '100vh', display: 'flex', justifyContent: 'center', alignItems: 'center', color: '#fff' }}>
        <div className="background-gallery">
          <div className="gallery-container">
            {images.map((image, index) => (
              <img key={index} src={image} alt={`Hotel Image ${index + 1}`} className={`gallery-image ${index === activeImage ? 'active' : ''}`} />
            ))}
          </div>
          <div className="gallery-controls">
            <button className="gallery-button prev-button" onClick={handlePrevClick}>
              <i className="fas fa-chevron-left"></i>
            </button>
            <button className="gallery-button next-button" onClick={handleNextClick}>
              <i className="fas fa-chevron-right"></i>
            </button>
          </div>
        </div>
        <h1>Welcome to Rental Apartments</h1>
      </div>
      <div className="container mt-5">
        <h1 className="text-center mb-4">Find Your Dream Apartment</h1>
        <SearchBar />
        <Link to="/search" className="btn btn-primary">View All Apartments</Link>
      </div>
    </div>
  );
};

export default Home;
